import React, { useState } from 'react';
import Header from './Header';
import './Searchpage.css';

const Searchpage = () => {
  const [locationFilter, setLocationFilter] = useState('');
  const [restaurantFilter, setRestaurantFilter] = useState('');

  // Dummy data for locations, restaurants, and menu items
  const locations = [
    { id: 1, name: 'Chennai' },
    { id: 2, name: 'Coimbatore' },
    { id: 3, name: 'Bangalore' },
  ];

  const restaurants = [
    { id: 1, name: 'Restaurant 1', locationId: 1 },
    { id: 2, name: 'Restaurant 2', locationId: 2 },
    { id: 3, name: 'Restaurant 3', locationId: 3 },
  ];

  const menuItems = [
    { id: 1, name: 'Item 1', restaurantId: 1 },
    { id: 2, name: 'Item 2', restaurantId: 1 },
    { id: 3, name: 'Item 3', restaurantId: 2 },
    { id: 4, name: 'Item 4', restaurantId: 2 },
    { id: 5, name: 'Item 5', restaurantId: 3 },
  ];

  const handleLocationFilter = (event) => {
    const selectedLocation = event.target.value;
    setLocationFilter(selectedLocation);
    setRestaurantFilter('');
  };

  const handleRestaurantFilter = (event) => {
    const selectedRestaurant = event.target.value;
    setRestaurantFilter(selectedRestaurant);
  };

  const getRestaurantsByLocation = () => {
    if (locationFilter) {
      return restaurants.filter((restaurant) => restaurant.locationId === parseInt(locationFilter));
    }
    return restaurants;
  };

  const getMenuItemsByRestaurant = () => {
    if (restaurantFilter) {
      return menuItems.filter((menuItem) => menuItem.restaurantId === parseInt(restaurantFilter));
    }
    return menuItems;
  };

  return (
    <div className="search-page">
      <div>
        <Header />
      </div>
      <div className="search-container">
        <div className="filter-container">
          <label htmlFor="location-filter">Location:</label>
          <select id="location-filter" value={locationFilter} onChange={handleLocationFilter}>
            <option value="">All</option>
            {locations.map((location) => (
              <option key={location.id} value={location.id}>
                {location.name}
              </option>
            ))}
          </select>
        </div>
        <div className="filter-container">
          <label htmlFor="restaurant-filter">Restaurant:</label>
          <select id="restaurant-filter" value={restaurantFilter} onChange={handleRestaurantFilter}>
            <option value="">All</option>
            {getRestaurantsByLocation().map((restaurant) => (
              <option key={restaurant.id} value={restaurant.id}>
                {restaurant.name}
              </option>
            ))}
          </select>
        </div>
        <div className="results-container">
          {locationFilter && (
            <div className="location-results">
              <h2>Restaurants in {locations.find((location) => location.id === parseInt(locationFilter)).name}:</h2>
              <ul>
                {getRestaurantsByLocation().map((restaurant) => (
                  <li key={restaurant.id}>{restaurant.name}</li>
                ))}
              </ul>
            </div>
          )}
          {restaurantFilter && (
            <div className="restaurant-results">
              <h2>Menu Items in {restaurants.find((restaurant) => restaurant.id === parseInt(restaurantFilter)).name}:</h2>
              <ul>
                {getMenuItemsByRestaurant().map((menuItem) => (
                  <li key={menuItem.id}>{menuItem.name}</li>
                ))}
              </ul>
            </div>          )}
        </div>
      </div>
    </div>
  );
};

export default Searchpage;
